import img from '../Assets/image.png';
function App() {
    return (
      <div className="App w-[100vw] h-[96vh] flex items-center gap-[1vh] justify-center  overflow-y-auto">
            <div className="w-[45vw] h-[50vh] bordertest"></div>
            <div className="w-[35vw] h-[60vh] bordertest rounded-lg overflow-hidden flex justify-center items-center">
                <img src={img}></img>
            </div>
      </div>
    );
  }
  
export default App;
